import React from "react"

function About() {
    return(
        <div className="about-section">
            <p>API: <a target='blank' href="https://docs.magicthegathering.io/">Magic: The Gathering API</a></p>
            <p>Libraries: <a href="https://create-react-app.dev/docs/getting-started/">React</a> and <a href="https://v5.reactrouter.com/web/guides/quick-start">React Router v5</a></p>
        </div>
    );
}

export default About;
